CREATE TABLE `newsrepos` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `organization_id` bigint NOT NULL COMMENT '所属組織 0:Aizen 1:アルケーエコ',
  `comment` varchar(1020) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'コメント',
  `report_flg` int DEFAULT '1' COMMENT 'フラグ 1:× 2:○',
  `mail_flg` int DEFAULT '1' COMMENT 'フラグ 1:MAIL 2:登録',
  `individual_mail` int DEFAULT '3' COMMENT '法人(1):個人(2):全て(3)',
  `interim_mail` int DEFAULT '13' COMMENT '決算月 1:1月～12:12月 13:全て',
  `announce_month` int DEFAULT '1' COMMENT '告知月(1):ー (2):決算月1ケ月前 (3):決算月1ケ月後 (4):決算月2ケ月後 (5):決算月7ケ月後',
  `file_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'アップロードファイルのオリジナルファイル名',
  `urgent_flg` int DEFAULT '1' COMMENT '至急フラグ(1):通常 (2):至急',
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
