INSERT INTO `newsrepos` VALUES (1,1,'システム更新されました',1,2,3,13,1,'',1,'2022-10-17 07:15:35','2022-08-23 03:25:34','2022-10-17 07:15:35'),(2,1,'「決算月１カ月前です。決算の打合せを行いましょう。」',1,1,1,9,2,'',1,'2022-10-14 05:25:35','2022-09-29 01:42:17','2022-10-14 05:25:35'),(3,1,'2023年10月1日からインボイス制度を適用するには\n2023年3月31日までに登録が必要です。\n\n登録をお考えの方は、ご一報ください。',1,2,3,13,1,'',1,'2022-10-14 05:27:09','2022-09-29 01:43:10',NULL),(4,1,'システムがリリースされました。\n\n①　今後、会計資料はこちらから共有頂けたらと思います\n\n②　重要なお知らせがあるかもしれないので、月に一度はシステムを開いてください',1,2,3,13,1,'',1,'2022-10-17 07:17:28','2022-10-17 07:17:28',NULL),(5,1,'【重要】\nシステムメンテナンス完了のご報告\n\nいつも大変お世話になっております。\n\n本日、9：00にシステムメンテナンスが完了しました。\nこれよりシステムの利用が可能となります。\n\nこの度は大変ご迷惑をおかけしたことをお詫び申し上げます。\n不明点等ございましたら、弊社までご一報頂けますようお願い申し上げます。',1,1,3,13,1,'',1,'2022-10-27 01:20:25','2022-10-27 01:20:25',NULL),(6,1,'【重要】\nシステムメンテナンス完了のご報告\n\n本日、9：00にシステムメンテナンスが完了しました。\nこれよりシステムの利用が可能となります。\n\nこの度は大変ご迷惑をおかけしたことをお詫び申し上げます。\n不明点等ございましたら、弊社までご一報頂けますようお願い申し上げます。',1,2,3,13,1,'',1,'2022-11-02 05:01:54','2022-10-27 01:21:27','2022-11-02 05:01:54'),(7,1,'【2022/12/1より国税の支払い方法に「QRコード支払い」が追加】\n\n国税の支払い方法につきまして、現状が「現金支払い」「クレジット支払い」以外に\n「QRコード支払い」が開始されます。\n国税の種類：https://www.mof.go.jp/tax_policy/summary/condition/a01.htm\n\n＜注意点＞\n・2022/12/1開始です\n・地方税はできません（県税、市税、個人事業税など）\n・１回の決済上限が30万円となります',1,2,3,13,1,'',1,'2022-11-02 05:01:59','2022-10-27 02:26:18','2022-11-02 05:01:59'),(8,1,'【2022/12/1より国税の支払い方法に「QRコード支払い」が追加】\n\n国税の支払い方法につきまして、現状が「現金支払い」「クレジット支払い」以外に\n「QRコード支払い」が開始されます。\n国税の種類：https://www.mof.go.jp/tax_policy/summary/condition/a01.htm\n\n＜注意点＞\n・2022/12/1開始です\n・地方税はできません（県税、市税、個人事業税など）\n・１回の決済上限が30万円となります',1,1,3,13,1,'',1,'2022-10-27 02:42:22','2022-10-27 02:42:22',NULL),(9,1,'【重要】インボイス登録のご依頼について\n\n2023年10月1日より【適格請求書等保存方式（通称：インボイス制度）】が始まります。\nつきましては、弊社にご依頼される方は下記のフォームから申込をお願いします。\n\nhttps://forms.gle/j5nvE6wXhp9jtxDE9\n\n申込期日：2022年11月17日（木曜）　18：00　まで\n\n\n※　登録すべきかの相談は別途ご連絡ください\n\n※　ご依頼頂き、弊社で申請した場合、開業届の住所に登録番号の記載された\n　　用紙が郵送されます。１～２か月後です。\n\n※　依頼されない場合でも、回答を頂けたらと思います。',1,1,2,13,1,'',1,'2022-11-08 01:30:06','2022-11-08 01:30:06',NULL),(10,1,'【年末調整の件】\r\n\r\n年末調整の件でご連絡させて頂きました。\r\n\r\n来月、年末調整 を行います。\r\n11/10の「事務所からの通知」にあるURLからお申込みの上、\r\n年末調整の資料をダウンロードし、弊社までご郵送ください。\r\n\r\n弊社へ年末調整をご依頼いただく場合、下記の料金にてお受けさせて頂きます。\r\n（以下税抜となります）\r\n\r\n　・計算例\r\n　　１名あたり5,000円\r\n　　例）３名の会社　：　３名×5,000円　＝　15,000円\r\n\r\n弊社にご依頼頂ける場合は、大変恐縮ですが【 11/18（金）】までに下記URLからお申込みください。\r\n\r\nhttps://forms.gle/1WyHTtP1Qt4gyx7E7\r\n\r\n＜注意事項＞\r\n\r\n※　期限付きの作業なので、以後にお返事頂いてもお受けできない場合がございます。\r\n\r\n※　「自分で確定申告する」「役員報酬を取ってないんだけど？」と、本作業が必要かどうかわからない場合、ご連絡頂けたらと思います。\r\n\r\n※　資料のダウンロードはシステムにログインして頂き、左の「2022年 年末調整資料」から可能です。\r\n　　印刷　→　記載　→　必要資料と一緒に郵送　をお願いします。\r\n　　システムのURLはこちら：https://www.tax-affairs.jp/\r\n\r\n※　資料郵送先\r\n　　\r\n　　株式会社アイゼン・ソリューション\r\n　　〒332-0017\r\n　　埼玉県川口市栄町3-11-11　コスモ川口栄町2F\r\n　　TEL：048-253-3922　　　　\r\n\r\n以上、よろしくお願い致します。',1,1,1,13,1,'',1,'2023-08-21 12:21:30','2022-11-10 08:23:16',NULL),(11,1,'【ご確認ください】\n\nインボイス登録の依頼について、先日ご連絡をさせて頂きました。\nこちら、弊社への申込期日が近いので、依頼する場合もしない場合も、下記から申請をお願い致します。\n\nhttps://forms.gle/cFATxxdn1cqJuwnD9',1,1,2,13,1,'',1,'2022-11-15 01:09:10','2022-11-15 01:09:10',NULL),(12,1,'【ご確認ください】 \n年末調整の依頼について、先日ご連絡をさせて頂きました。\nこちら、弊社への申込期日が近いので、依頼する場合もしない場合も、下記から申請をお願い致します。\n\n申込期日：11/18（金）\n\nhttps://forms.gle/cypW3jryB8qHyP9NA',1,1,1,13,1,'',1,'2022-11-15 01:12:37','2022-11-15 01:12:37',NULL),(13,1,'【本日締め切りです】 \n\nインボイス登録の依頼について、ご連絡をさせて頂きました。\nまだ依頼をしていない方は、下記から申請をお願い致します。 \nhttps://forms.gle/cFATxxdn1cqJuwnD9\n\n※　依頼する場合もしない場合も、「依頼しない」で申し込みをお願いします\n※　申請された方は再送の必要はございません',1,1,2,13,1,'',1,'2022-11-17 01:56:27','2024-11-17 01:56:27',NULL),(14,1,'【本日締め切りです】 \n\n年末調整の依頼について、ご連絡をさせて頂きました。 \nまだ依頼をしていない方は、下記から申請をお願い致します。 \n\nhttps://forms.gle/cypW3jryB8qHyP9NA\n\n※　依頼しない場合は「依頼しない」で申し込みをお願いします \n※　すでに申請された方は再送の必要はございません\n\n\nご依頼される方はシステム左にある「年末調整資料」をダウンロードして頂き、\n印刷、記載、郵送をお願いします。',1,1,1,13,1,'',1,'2022-11-18 00:44:39','2023-11-18 00:44:39',NULL),(15,1,'【備忘：年末調整資料のご提出について】 \r\n\r\n年末調整をご依頼された事業主様につきまして、『システム左にある「年末調整資料」（赤字）を\r\nダウンロードして頂き、印刷、記載、郵送』をお願いします。\r\n期限は『12/7（水）必着』です。\r\n\r\n・　資料郵送先\r\n　　\r\n　　株式会社アイゼン・ソリューション\r\n　　〒332-0017\r\n　　埼玉県川口市栄町3-11-11　コスモ川口栄町2F\r\n　　TEL：048-253-3922　　　　\r\n\r\n・　『年末調整をしないが「給与支払報告書」は提出してほしい』\r\n　　『年末調整をしないが「源泉徴収票」は提出してほしい』\r\n　　という社員様がいらっしゃった場合は別途ご連絡をください。\r\n\r\n・　まだ年末調整のご依頼をしていない方は、下記から申請をお願い致します。 \r\n\r\n　　https://forms.gle/cypW3jryB8qHyP9NA\r\n\r\n　　※　依頼しない場合は「依頼しない」で申し込みをお願いします \r\n　　※　すでに申請された方は再送の必要はございません',1,1,1,13,1,'',1,'2023-08-21 12:20:17','2023-11-29 04:39:32',NULL),(16,1,'いつも大変お世話になっております。\r\n新冨でございます。\r\n\r\n今年も大変お世話になりました。\r\n\r\n２月より確定申告がはじまります。\r\n直前で慌てないように、下記を1月に提出できるように事前準備をお願いします。\r\n\r\n\r\n＜12月31日にやってほしいこと＞\r\n・事業用で使っている12月末の電子マネーの残高\r\n　（スクリーンショットなどでも構いません）\r\n・（物販や飲食の事業をやっている方）12月末時点の在庫・食品棚卸金額\r\n\r\n\r\n＜1月10日までにほしいもの＞\r\n・12月末までの各通帳のデータ\r\n・クレジットカード利用分のデータ\r\n\r\n\r\n＜確定申告で用意しておく資料＞\r\n・生命保険の生命保険料控除証明書\r\n　→　はがきが届いているはずです\r\n\r\n・国民健康保険\r\n　→　2022年に支払った額がわかればOKですので\r\n　　　領収書などがなければ役所に問い合わせて聞いてください\r\n　　　PDF・画像データ、もしくは口頭での申告でOKです\r\n\r\n・国民年金\r\n　→　支払いの証明書が届いていると思います\r\n　　　PDF・画像データでOKです\r\n\r\n・扶養のご家族がいらっしゃいましたら、\r\n　お名前、マイナンバー、生年月日、続柄を教えてください\r\n\r\n・住宅ローン控除\r\n　→　受けていれば別途教えてください\r\n\r\n・不動産や株の配当等がございましたら教えてください\r\n\r\n・ふるさと納税をされている場合、「寄付金受領の証明書」が送られてきます\r\n　そちらの画像データをください\r\n\r\n・事務所として使っている場所で「賃貸」の場合、「賃貸借契約書」の\r\n　コピーをお願いします\r\n　（自宅の賃貸借契約書でもOK)\r\n\r\n・予定納税といって税金を先払いする制度があります\r\n　もし2022年に支払いをしている場合、その納付した領収書の画像データをお願いします\r\n\r\n・個人事業税を支払している場合、領収書を取っておいてください\r\n　税金ですが経費になります\r\n\r\n\r\n来年はインボイス制度が始まるなど、大変な一年になると予測されます。\r\n年末年始でも新冨は連絡がつきますので、何かございましたらいつでもご連絡ください。\r\n\r\n引き続きよろしくお願い致します。',1,1,2,13,1,'',2,'2023-08-29 05:29:26','2024-12-28 10:57:59',NULL),(17,1,'TEST\r\nwww.aizen-sol.co.jp',1,1,2,13,1,'【御申込書】株式会社アイゼン・ソリューション様 (1).pdf',1,'2023-11-08 09:35:12','2023-01-10 05:59:10','2023-11-08 09:35:12'),(18,1,'TEST\r\nwww.amazon.co.jp',1,1,1,13,1,'202212インホ_イス登録通知書.pdf',1,'2023-11-08 09:35:15','2023-01-10 06:06:08','2023-11-08 09:35:15');
