--
-- Table structure for table `spedelidates`
--

DROP TABLE IF EXISTS `spedelidates`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `spedelidates` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `organization_id` bigint NOT NULL COMMENT '所属組織 0:Aizen 1:アルケーエコ',
  `custm_id` int NOT NULL DEFAULT '1' COMMENT '顧客id',
  `year` bigint NOT NULL DEFAULT '0' COMMENT '年',
  `officecompe` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '役員報酬',
  `employee` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '従業員',
  `paymenttype` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '納付種別',
  `adept_flg` int DEFAULT '1' COMMENT '達人フラグ 1:× 2:○',
  `payslip_flg` int DEFAULT '1' COMMENT '納付書作成 1:× 2:○',
  `declaration_flg` int DEFAULT '1' COMMENT '0円納付申告 1:× 2:○',
  `paydate_att` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '支払日注意',
  `checklist` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '確認事項',
  `chaneg_flg` int DEFAULT '1' COMMENT '役員報酬変更なしあり 1:× 2:○',
  `after_change` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '変更後',
  `change_time` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '変更時期',
  `linkage_pay` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '納付書データの連携',
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

